import React from 'react'
import '../css/call.css'
import tippy from 'tippy.js';
import 'tippy.js/dist/tippy.css';

function CallControls() {
	tippy('#singleElement', {
		content: 'Tooltip',
	  });
	return (
		<div className="call__controls">
			<button className="btn btn-light btn-round zoom__on-hover" data-tippy-content="asd">
				<i className="fas fa-microphone-alt-slash"></i>
			</button>
			&nbsp;
			<button className="btn btn-light btn-round zoom__on-hover">
				<i className="fas fa-video"></i>
			</button>
			&nbsp;
			<button className="btn btn-danger btn-round zoom__on-hover">
				<i className="fas fa-phone-slash"></i>
			</button>
			&nbsp;
			<button className="btn btn-light btn-round zoom__on-hover">
				<i className="fas fa-clone"></i>
			</button>
			&nbsp;
			<button className="btn btn-light btn-round zoom__on-hover">
				<i className="fas fa-cog"></i>
			</button>
		</div>
	)
}

export default CallControls
